  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for North
  Platte National Wildlife Refuge outlines Refuge accomplishments during the 1977
  calendar year. The report begins by describing the climate and habitat conditions
  in the Refuge, as well as the land acquisition program and system status. The habitat
  management section discusses grasslands and wetlands. Wildlife- including migratory
  birds, big game animals, and raptors- are discussed. The public relations sections
  describes recreational uses and enforcement. Items of interest, N-R forms, and photographs
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
